// src/Reports.js

import React from 'react';

const Reports = () => {
  return (
    <div className="dashboard">
      <h1>Reports</h1>
      <ul>
        <li>Total Interviews: 20</li>
        <li>Upcoming Interviews: 5</li>
        <li>Completed Interviews: 15</li>
      </ul>
    </div>
  );
};

export default Reports;
